import styled from 'styled-components'

const Display = ({display}) => {

    return (

        <Wrapper>
            <Screen>
                <SampleText>
                    {display}
                </SampleText>
            </Screen>
        </Wrapper>

    )
}

export default Display

const Wrapper = styled.div`
height: 100%;
`

const Screen = styled.div`
/* border: 22px solid #5a5e61; */
border: 22px solid rgba(54,71,81,255);
background-color: #748c8c;
margin: 5px;
height: 115px;
width: 300px;
`

const SampleText = styled.p`
font-family: lcd;
font-weight: 300;
font-size: 30px;
margin-left: 10px;
margin-top: 10px;
`
